import { Component } from "react"
import Cuerpo from "./cuerpo/cuerpo"
import Encabezado from "./encabezado"
import axios from '../conexion';

class Principal extends Component{
    constructor(props){
        super(props);
        this.state={
            suma:0
        }
    }
    calcular = async (props)=>{
        var config = {
            method: 'get',
            url: 'http://localhost:3200/api/operation/suma/'+ props.id,
            headers: { 
              'Content-Type': 'application/x-www-form-urlencoded'
            },
        };
        const operation= await axios(config);
        console.log(operation.data);
        this.setState({suma: operation.data})
    }

    render(){
        return(
            <div>
                <Encabezado id= {this.props.id} />
                <Cuerpo id= {this.props.id}/>
            </div>
        )
    }
}

export default Principal;
